import React, {Component} from 'react';
import "./welcome.css";

class Welcome extends Component {
    render () {
        return (
            <div className="container">
                <div className="title">
                    <h1>Discover and Play</h1>
                    <h2>Explore the Museum in a whole new way</h2>
                    <label for="email-input">Email</label>
                    <input
                        type="text"
                        title="Email"
                        id="email-input"
                    />
                </div>
            </div>
        );
    }
}

export default Welcome;
